        <b>KARUR</b>
        <hr />
        <p>Address<span className="pl-11">:</span> <span className="pr-20">1st floor, Ashoka Towers, Kovai Main Rd,</span></p>
        <p className="pl-28">op.Ajantha Theater, Karur,</p>
        <p className="pl-36">Tamil Nadu 639002</p>
